import './ExpemseItem.css';

function ExpenseItem() {
    let title = "Buy Books"
    return (
        <div className="expense-item">
            <div>March 12th 2022</div>
            <div className="expense-info">
                <h2>{title}</h2>
                <div className="expense-price">$200</div>
            </div>

        </div>
    );
}

export default ExpenseItem;
